import './yourProfile.scss'
import { connect } from 'react-redux';
import React, { useEffect } from 'react';
import SiteManagerTable from './site manager/SiteManagerTable';
import AuctionManagerTable from './auction manager/AuctionManagerTable';
import UserTable from './UserTable';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'
import EditAuction from './auction manager/EditAuction'
import AuctionResults from './auction manager/AuctionResults'
import AuctionStatistics from './auction manager/AuctionStatistics'
import { useStorageReducer } from 'react-storage-hooks';
import { userReducer as reducer, initialState as userState } from '../../store/reducers/userState.js'
import * as actionTypes from '../../store/actionTypes';

const YourProfile = (props) => {
    const [state, dispatch, writeError] = useStorageReducer(
        localStorage,
        'user',
        reducer,
        userState
    );

    return (
        <Switch>
            <Route path={'/your_profile/edit_auction'}>{state.currentUser.status === 'AUCTION_MANAGER' ? <EditAuction /> : null}</Route>
            <Route path={'/your_profile/statistics'}>{state.currentUser.status === 'AUCTION_MANAGER' ? < AuctionStatistics /> : null}</Route>
            <Route path={'/your_profile/results'}>{state.currentUser.status === 'AUCTION_MANAGER' ? <AuctionResults /> : null}</Route>
            <Route path={'/your_profile'}>{state.currentUser.status === 'SITE_MANAGER' ? (<SiteManagerTable />) : state.currentUser.status === 'AUCTION_MANAGER' ? (<AuctionManagerTable />) : (<UserTable />)}</Route>
        </Switch>
    );
}


export default YourProfile;
